import computerImage1 from "./images/computerImage1.png";

import "./MainBack.css";

const MainBack = () => {
  return (
    <div className="mainback">
      <div className="main_picture">
        <img
          className="backpic responsive"
          src={computerImage1}
          style={{ width: "100%" }}
        />
      </div>
      {/* <div className="motto">
